import { useSelector } from "react-redux"

export default function Favorites() {
    const myFavorites = useSelector((state) => state.myFavorites);
    return (
        <>
            {myFavorites.map((fav) =>
                <div>
                    <span>{fav.name}</span>
                    <img src={fav.image} alt={fav.name} />
                </div>
            )}
        </>
    )
}
